                if (txtValue.toUpperCase().indexOf(filter) > -1) {
                    tr[i].style.display = """";
                } else {
                    tr[i].style.display = ""none"";
                }
            }
            var elem = document.getElementById(""quantTd"");
            elem.value = tr.length.toString;

        }
